import { useState } from "react"
import Link from "next/link";

import { useQuery } from "@apollo/react-hooks";
import gql from "graphql-tag";

const GET_ROCKETS = gql`
  query GetLaunch {
    rockets {
      id,
      name
    }
  }
`;

const Navbar = () => {

  const { data, loading, error } = useQuery(GET_ROCKETS);
  const [id] = useState(data.rockets.id)

  if (loading) return null;
  if (error) return <p>SOMETHING ERROR</p>;
  if (!data) return <p>Not found</p>;

  console.log(data);


  console.log(`this is id ${id}`)

  return (
    <div>
      <nav class="navbar is-black" role="navigation" aria-label="main navigation" style={{ height: '10vh' }}>
        <div class="navbar-brand">
          <a class="navbar-item" style={{ marginLeft: '100px' }}>
            <img src="https://www.spacex.com/sites/spacex/files/spacex_logo_white.png" alt="space x logo" />
          </a>

          <a role="button" class="navbar-burger burger" aria-label="menu" aria-expanded="false" data-target="navbarBasicExample">
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
            <span aria-hidden="true"></span>
          </a>
        </div>

        <div id="navbarBasicExample" class="navbar-menu">
          <div class="navbar-start" style={{ margin: 'auto' }}>

            {data.rockets.map(rocket => (
              <Link href="/rockets/[id]" as={`/rockets/${id}`}>
              <a class="navbar-item">
                {rocket.name}
              </a>
              </Link>
            ))}

          </div>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
